function setDPIRazer(dpi){
	savedDpi1 = dpi;

	let packet = [];
	packet[0] = 0x00;
	packet[1] = 0x00;
	packet[2] = 0x1F;
	packet[3] = 0x00;
	packet[4] = 0x00;
	packet[5] = 0x00;
	packet[6] = 0x26;
	packet[7] = 0x04;
	packet[8] = 0x06;
	packet[9] = 0x01;
	packet[10] = 0x01;
	packet[11] = 0x01;
	packet[12] = 0x00;
	packet[13] = Math.floor(dpi/256);
	packet[14] = dpi%256;
	packet[15] = Math.floor(dpi/256);
	packet[16] = dpi%256;
	packet[89] = CalculateCrc(packet);

	device.send_report(packet, 91);
}

export function Initialize() {
	if(DpiControl) {
		setDPIRazer(dpi1);

	}
}

function SendPacket(){


	let packet = [];
	packet[0] = 0x00;
	packet[1] = 0x00;
	packet[2] = 0x1F;
	packet[3] = 0x00;
	packet[4] = 0x00;
	packet[5] = 0x00;
	packet[6] = 0x08;
	packet[7] = 0x0F;
	packet[8] = 0x03;


	for(let iIdx = 0; iIdx < vLedPositions.length; iIdx++){

		let iPxX = vLedPositions[iIdx][0];
		let iPxY = vLedPositions[iIdx][1];
		let col = device.color(iPxX, iPxY);

		let iLedIdx = (iIdx*3) + 14;
		packet[iLedIdx] = col[0];
		packet[iLedIdx+1] = col[1];
		packet[iLedIdx+2] = col[2];
	}

	packet[89] = CalculateCrc(packet);

	device.send_report(packet, 91);
}


function Apply() {
	let packet = []; //new Array(91).fill(0);
	packet[0] = 0x00;
	packet[1] = 0x00;
	packet[2] = 0x08;
	packet[3] = 0x00;
	packet[4] = 0x00;
	packet[5] = 0x00;
	packet[6] = 0x02;
	packet[7] = 0x00;
	packet[8] = 0x086;


	packet[89] = CalculateCrc(packet);

	device.send_report(packet, 91);
	device.pause(1); // We need a pause here (between packets), otherwise the ornata can't keep up.

}


